import React from 'react';
import { Link } from 'react-router-dom';
import Sidebar from '../components/Sidebar';

import './Header.css'; // Import the CSS file

function Header() {
    
    return (
        <header className="header">
            <button className='btn btn-dark me-2' href='#sidebar' data-bs-toggle="offcanvas" aria-controls="sidebar">
    <i className="bi bi-justify start-0 position-relative bottom-0 right-0"  />
    </button>
            <h1 className="header-title">Starlight Tracker</h1>
            <Sidebar />
            <div className="scroll-container"> {/* Scrollable container */}
                
            </div>
        </header>
    );
}

export default Header;
